window.bookSummaryJSON = "<p>After triumphing in <i>Star Wars: The Unifying Force</i>, the heroes of the New Jedi Order return in a dazzling new adventure!</p> <p>Luke Skywalker is worried: A handful of Jedi Knights, including his nephew and niece, Jaina and Jacen Solo, have disappeared into the Unknown Regions in response to a strange cry for help that only they could hear. Now the alien Chiss have angrily lodged a formal complaint, accusing the missing Jedi of meddling in a border dispute between the Chiss and an unidentified aggressor.&nbsp;</p> <p>Luke has no choice but to head to the Unknown Regions for serious damage control. Han and Leia follow, intent on protecting their children from what could be grave danger. But none of them are prepared for what they find when they reach their destination.</p> <p>A colony of mysterious aliens is expanding toward the edge of Chiss space. The leader of the alien nest is resolute. Adept in the Force, he is drawing old friends to his side, compelling them to join the colony and meld their Force-abilities with his - even if it leads to all-out war....</p>"; 
